import React, { useState } from 'react';


const StateDemoComponent = () => {
    useState("Venus")
    let name = "Venus";
    const changeName=(inputname)=>{
        name = inputname;
    }
    return ( 
        <>
            <h2>{name}</h2>
            <button onClick={()=>changeName("Velazquez")}>Change Name</button>
        </>
     );
}
 
export default StateDemoComponent;
